Page[12]=new Array("Anden type giver dig mulighed for at vælge en ønsket papirtype for din opgave.","Bemærk: ","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Hvis der vælges en papirtype, der ikke er lagt i printeren, tilbageholdes opgaven på printeren, indtil det valgte papir er ilagt.","Sådan vælges en papirtype:","Klik på piltasterne ud for Papir i vinduet Papir/output og vælg Anden type.","Gør et af følgende:","Vælg Printerstandard for at anvende printerens standardpapirtype.","Vælg Automatisk valg for at vælge et papirmagasin, som indeholder en hvilken som helst papirfarve.","Vælg en Papirtype eller klik på Brugerdefineret for at oprette en brugerdefineret papirtype.","Angiv antallet under Faneblade.","Hvis du valgte Forsorteret papir, skal du angive antallet.","Papirtype","other_type.html");
