Page[16]=new Array("Sådan vælges en papirvægt:","Klik på piltasterne ud for Papir i vinduet Papir/output og vælg Anden vægt.","Gør et af følgende:","Vælg Printerstandard for at anvende standardpapirvægten for printeren.","Vælg en papirvægt på listen.","Vælg Brugerdefineret for at anvende en vægt, som ikke er vist på listen.","Bemærk: De tilladte minimum- og maksimumpapirvægte afhænger af printeren. Hvis du angiver en brugerdefineret vægt, skal du kontrollere, at det er en acceptabel, understøttet vægt for printeren.","Papirvægt","other_weight.html");
