Page[18]=new Array("Avanceret papirvalg gør det muligt at vælge forskellige papiregenskaber fra ét enkelt vindue. Paperoversigten viser en oversigt over valgene.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan vælges papiregenskaber vha. Avanceret papirvalg:","Vælg Papirnavn ud for Papir og vælg den ønskede indstilling for at tilføje eller opdatere egenskaber for et papirnavn.","Bemærk: Printerdriveren kan gemme op til 10 navne. Når du tilføjer 11 navne, slettes navnet, der bruges mindst automatisk fra listen. Vælg Slet liste for at slette et andet navn fra listen end det valgte.","Klik på piltasterne ud for Papir i vinduet Papir/output og vælg Avanceret papirvalg.","Slet markeringen i afkrydsningsfeltet Brug kun navn (ekspert) for at vælge individuelle egenskaber.","Vælg et Papirformat eller klik på Brugerdefineret for at oprette et brugerdefineret papirformat.","Vælg en Papirfarve eller klik på Brugerdefineret for at oprette en brugerdefineret papirfarve.","Vælg en Papirtype eller klik på Brugerdefineret for at oprette en brugerdefineret papirtype.","Vælg en Papirvægt (gsm) eller klik på Brugerdefineret for at oprette en brugerdefineret papirvægt.","Vælg en indstilling for Forhullet papir.","Vælg en indstilling for Coated.","Papirets overflade påvirker den udskrevne opgaves udseende. Anvend Coated til at coate udskrivningsopgaven. Du kan også vælge at coate en eller begge sider af papiret.","Vælg en indstilling for Coated-type.","Angiv den type coating, der anvendes på coated papir. Typen kan påvirke udseendet af det udskrevne dokument.","Vælg en indstilling for Fiberretning.","Fiberretning angiver fiberretningen for opgaven. Fiberretningen kan påvirke udseendet af det udskrevne dokument.","Vælg en indstilling for Efterbehandling af papir.","Efterbehandling af papir giver dig mulighed for at vælge en ønsket efterbehandlingstype for din opgave. Det vil påvirke udseendet af det udskrevne dokument.","Under Beskrivelse skal du vælge Printerens standard, en beskrivelse fra listen eller indtaste en ny beskrivelse.","Hvis du vil tilføje yderligere oplysninger om dine valg, skal du indtaste dem i Kommentar (valgfrit).","Klik på OK.","Avanceret papirvalg","advanced_paper_selection.html");
Page[19]=new Array("Indtast en værdi for den brugerdefinerede bredde ud for Bredde i vinduet Brugerdefineret format eller brug piltasterne til at vælge en værdi.","Indtast en værdi for den brugerdefinerede højde ud for Højde eller brug piltasterne til at vælge en værdi.","Klik på piltasterne i feltet Måleenheder og vælg tommer eller mm.","Klik på OK.","Oprettelse af brugerdefineret papirformat","custom_size.html");
Page[20]=new Array("Klik på piltasterne ud for 2-sidet udskrivning i vinduet Papir/output og vælg en indstilling.","1-sidet udskrivning: Udskriver på den ene side af papiret. Anvend denne indstilling ved udskrivning på transparenter, konvolutter, etiketter eller andet materiale, som ikke kan udskrives på begge sider.","2-sidet udskrivning: Udskriver på begge sider af papiret, så der kan indbindes langs den lange kant.","2-sidet, blokformat: Udskriver på begge sider af papiret, så der kan indbindes langs den korte kant.","1- eller 2-sidet","2_sided_printing.html");
