Page[22]=new Array("Efterbehandling anvendes til at vælge, hvordan dine udskrevne opgaver leveres. Du kan f.eks. vælge hulning, hæftning, foldning eller pjecer.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Hæftning","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Hæftning.","Vælg en indstilling for antallet og placeringen af hæfteklammer.","Hulning","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Hulning.","Vælg en indstilling for antallet og placeringen af huller.","Foldning","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Foldning.","Vælg en mulighed:","2-foldning, et ark, udskriv indvendig: Udskriver dokumentets første side på indersiden af det foldede papir. Der udskrives på en side og hvert ark foldes individuelt.","2-foldning, et ark, udskriv på yderside: Udskriver dokumentets første side på ydersiden af det foldede papir. Der udskrives på en side og hvert ark foldes individuelt.","2-foldning, flere ark (Pjecefoldning): Udskriver de ulige sider på ydersiden, og de ​​lige sider på indersiden af ​​det foldede papir. Ark foldes sammen som en pjece.","C-foldning, udskriv indvendig: Starter udskrivningen på indersiden af det første ark. Den udvendige side af det foldede dokumentet er tom.","C-foldning, udskriv udvendig: Starter udskrivningen på ydersiden af det foldede dokument.","Z-foldning, halvt ark, indbinding til venstre: Folder arket som et Z og indbinder langs venstre kant.","Z-foldning, halvt ark, indbinding til højre: Folder arket som et Z og indbinder langs højre kant.","Z-foldning, udskriv indvendig: Starter udskrivningen på indersiden af det første ark. Den udvendige side af det foldede dokumentet er tom.","Z-foldning, udskriv udvendig: Starter udskrivningen på ydersiden af det foldede dokument.","Hvis du vælger 2-foldning, flere ark (Pjecefoldning), skal du eventuelt vælge yderligere indstillinger.","Firkantet foldning","Beskær den yderste kant","Perfect-indbinding","Mere efterbehandling","Mere efterbehandling giver dig mulighed for at vælge flere efterbehandlingsmuligheder for den samme opgave i et enkelt vindue.","Sådan vælges en indstilling for mere efterbehandliing","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Mere efterbehandling.","Vælg en indstilling.","Hæftning","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Hæftning.","Vælg en indstilling for antallet og placeringen af hæfteklammer.","Hulning","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Hulning.","Vælg en indstilling for antallet og placeringen af huller.","Foldning","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Foldning.","Vælg en mulighed:","2-foldning, et ark, udskriv indvendig: Udskriver dokumentets første side på indersiden af det foldede papir. Der udskrives på en side og hvert ark foldes individuelt.","2-foldning, et ark, udskriv på yderside: Udskriver dokumentets første side på ydersiden af det foldede papir. Der udskrives på en side og hvert ark foldes individuelt.","2-foldning, flere ark (Pjecefoldning): Udskriver de ulige sider på ydersiden, og de ​​lige sider på indersiden af ​​det foldede papir. Ark foldes sammen som en pjece.","C-foldning, udskriv indvendig: Starter udskrivningen på indersiden af det første ark. Den udvendige side af det foldede dokumentet er tom.","C-foldning, udskriv udvendig: Starter udskrivningen på ydersiden af det foldede dokument.","Z-foldning, halvt ark, indbinding til venstre: Folder arket som et Z og indbinder langs venstre kant.","Z-foldning, halvt ark, indbinding til højre: Folder arket som et Z og indbinder langs højre kant.","Z-foldning, udskriv indvendig: Starter udskrivningen på indersiden af det første ark. Den udvendige side af det foldede dokumentet er tom.","Z-foldning, udskriv udvendig: Starter udskrivningen på ydersiden af det foldede dokument.","Hvis du vælger 2-foldning, flere ark (Pjecefoldning), skal du eventuelt vælge yderligere indstillinger.","Firkantet foldning","Beskær den yderste kant","Bemærk: I vinduet Mere efterbehandling er de eneste tilgængelige foldningsindstillinger Ingen og Z-foldning, halvt ark Aktiveret.","Klik på OK.","Brugerdefineret","DFA-efterbehandlerprofiler forbinder dig til en efterbehandlerprofil, der er oprettet på printeren. Når du har oprettet et brugerdefineret navn for en efterbehandler, vises det i printerdriveren.","Sådan indtastes et nyt navn:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Brugerdefineret.","Indtast DFA-efterbehandlernavnet i feltet Brugerdefineret.","Klik på OK.","Skilleark","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Skilleark.","Vælg en mulighed:","Ja eller Aktiveret: Indsætter et skilleark.","Nej eller Inaktiveret: Inaktiverer funktionen.","Klik på OK.","Forskydning/undersæt","Blokke","Pjecer","Efterbehandling","finishing.html");
