Page[25]=new Array("Sådan udskrives der med Foldning:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Foldning.","Vælg en mulighed:","2-foldning, et ark, udskriv indvendig: Udskriver dokumentets første side på indersiden af det foldede papir. Der udskrives på en side og hvert ark foldes individuelt.","2-foldning, et ark, udskriv på yderside: Udskriver dokumentets første side på ydersiden af det foldede papir. Der udskrives på en side og hvert ark foldes individuelt.","2-foldning, flere ark (Pjecefoldning): Udskriver de ulige sider på ydersiden, og de ​​lige sider på indersiden af ​​det foldede papir. Ark foldes sammen som en pjece.","C-foldning, udskriv indvendig: Starter udskrivningen på indersiden af det første ark. Den udvendige side af det foldede dokumentet er tom.","C-foldning, udskriv udvendig: Starter udskrivningen på ydersiden af det foldede dokument.","Z-foldning, halvt ark, indbinding til venstre: Folder arket som et Z og indbinder langs venstre kant.","Z-foldning, halvt ark, indbinding til højre: Folder arket som et Z og indbinder langs højre kant.","Z-foldning, udskriv indvendig: Starter udskrivningen på indersiden af det første ark. Den udvendige side af det foldede dokumentet er tom.","Z-foldning, udskriv udvendig: Starter udskrivningen på ydersiden af det foldede dokument.","Hvis du vælger 2-foldning, flere ark (Pjecefoldning), skal du eventuelt vælge yderligere indstillinger.","Firkantet foldning","Beskær den yderste kant","Foldning","folding.html");
Page[26]=new Array("Kvadratfoldning angiver, hvor meget ryggen af ​​kvadratfoldede pjecer skal foldes.","Sådan vælges indstillinger for Firkantet foldning:","Vælg en indstilling ud for Firkantet foldning i vinduet Firkantet foldning.","Vælg Normal til +2 for at vælge en mere 'firkantet' foldning.","Vælg Normal til -2 for at vælge en 'rundere' foldning.","Vælg Nej for at inaktivere Firkantet foldning.","Klik på OK.","Firkantet foldning","square_fold.html");
Page[27]=new Array("Funktionen Beskær den yderste kant angiver, hvor meget der skal skæres af den udvendige kant af en pjece.","Sådan beskæres den yderste kant:","Marker afkrydsningsfeltet for at aktivere Beskær den yderste kant.","Indtast en værdi ud for Beskær den yderste kant eller brug piltasterne til at vælge en beskæringsværdi for den yderste kant.","Klik på piltasterne i feltet Måleenheder og vælg tommer eller mm.","Klik på OK.","Beskær den yderste kant","trim_outside_edge.html");
Page[28]=new Array("Anvend Perfect Binder til at udskrive og indbinde bøger. Den folder og limer et omslag rundt om bogen. Du kan også beskære bogen til det ønskede format.","Bemærk: ","Denne indstilling vises kun, hvis den relevante efterbehandler er installeret på din printer. Den vises ikke, hvis der er valgt omslag, hæftning, hulning, indbinding, foldning eller pjecelayout.","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan anvendes Perfect Binder:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Perfect-indbinding.","Vælg en indstilling ud for Indbindingskant.","Stående - Venstre: Indstiller retningen til stående og indbinder langs den venstre kant.","Stående - Højre: Indstiller retningen til stående og indbinder langs den højre kant.","Liggende - Øverst: Indstiller retningen til liggende og indbinder langs den øverste kant.","Liggende - Nederst: Indstiller retningen til liggende og indbinder langs den nederste kant.","Klik på Beskæring, og vælg en indstilling.","Ingen beskæring: Beskærer ikke siderne.","Forkant: Beskærer den kant, som er modsat indbindingskanten.","Tryk ud over renskåret kant: Aktiverer Beskæringsformat, så du kan vælge et beskæringsformat. Tryk ud over renskåret kant tillader, at billedet udvides til kanten af papiret.","Hvis du ønsker at vælge et beskæringsformat, skal du klikke på Beskæringsformat og vælge fra en liste over formater eller vælge Brugerdefineret for at vælge et brugerdefineret format.","Vælg følgende indstillinger for at vælge papir for omslaget fra listen Omslag.","Papirnavn: Gør det muligt at vælge et papirnavn fra en liste eller opret et nyt Papirnavn.","Andet format: Denne indstilling gør det muligt at vælge papirformat eller oprette et brugerdefineret format.","Anden farve: Gør det muligt at vælge fra en liste over tilgængelige farver eller oprette en brugerdefineret farve.","Anden type: Gør det muligt at vælge papirtypen eller oprette brugerdefinerede papirtyper.","Anden vægt: Gør det muligt at vælge papirets vægt eller oprette en brugerdefineret papirvægt.","Avanceret papirvalg: Lader dig vælge avancerede papiregenskaber for dit omslag.","Klik på OK.","Perfect Binder","perfect_binder.html");
Page[29]=new Array("Mere efterbehandling giver dig mulighed for at vælge flere efterbehandlingsmuligheder for den samme opgave i et enkelt vindue.","Sådan udskrives der med Mere efterbehandling:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Mere efterbehandling.","Vælg et eller flere indstillinger.","Hæftning","Hulning","Foldning","Bemærk: ","Afhængigt af hvilken indstilling du vælger først, ændres placeringsindstillingerne for hæftning og hulning.","Z-foldning, halvt ark er ikke tilgængelig for alle konfigurationer.","Klik på OK.","Mere efterbehandling","multiple_finishing.html");
Page[30]=new Array("DFA-efterbehandlerprofiler forbinder dig til en efterbehandlerprofil, der er oprettet på printeren. Når du har oprettet et brugerdefineret navn for en efterbehandler, vises det i printerdriveren.","Sådan indtastes et nyt navn:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Brugerdefineret.","Indtast DFA-efterbehandlernavnet i feltet Brugerdefineret.","Klik på OK.","DFA-efterbehandlerprofiler","custom_finishing.html");
Page[31]=new Array("Et skilleark er et blankt ark, som printeren indsætter, når der udskrives mange kopier i en opgave, der leveres som sorterede eller stakkede dokumenter.","Sådan vælges en indstilling for Skilleark:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Skilleark.","Vælg en mulighed:","Ja eller Aktiveret: Indsætter et skilleark.","Nej eller Inaktiveret: Inaktiverer funktionen.","Klik på OK.","Skilleark","slip_sheets.html");
Page[32]=new Array("Forskyd output afgør, hvordan kopier forskydes i opgaver med mange kopier. Når funktionen er aktiveret, forskydes kopierne en smule i forhold til hinanden i udfaldsbakken. Denne funktion er tilgængelig, hvis udfaldsbakken kan forskyde output.","Sådan anvendes Forskydning/undersæt:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Forskydning/undersæt.","Vælg en indstilling.","Printerstandard: Anvender standardprinterindstillinger.","Ingen: Denne indstilling inaktiverer forskydning. Du kan stadig vælge undersæt.","Hvert sæt: Denne indstilling forskyder hvert sæt i en opgave, som består af mange kopisæt.","Hvert undersæt forskyder et specifikt antal sider i et enkelt sæt.","Efter hvert sæt og hvert undersæt forskyder et specifikt antal sider i et sæt og forskyder også hvert sæt i en opgave bestående af mange kopisæt.","Vælg Aktiver undersæt for at udskrive undersæt i en opgave.","I Sider pr. undersæt skal du indtaste antallet af sider i hvert undersæt. Hvert undersæt skal indeholde det samme antal sider.","Klik på OK.","Forskydning/undersæt","offset_subset.html");
Page[33]=new Array("Denne funktion gør det muligt at lave blokke af enkeltsidede formularer, så det er let af rive hver formular af blokken efter behov. En blok har som regel en bagside af karton og en indbinding langs den øverste kant.","Sådan udskrives blokke:","Klik på piltasterne ud for Efterbehandling i vinduet Papir/output og vælg Blokke.","Vælg en indstilling ved siden af Blokke:","Inaktiveret: Inaktiverer funktionen.","Aktiveret: Aktiverer blokudskrivning.","Vælg en af følgende muligheder for Antal blokke:","Indtast det antal blokke, der skal udskrives.","Vælg Printerstandard for at anvende printerens standardindstilling.","Vælg en af følgende muligheder for Ark pr. blok:","Indtast antallet af ark i hver blok.","Vælg Printerstandard for at anvende printerens standardindstilling.","Under Bagside skal du vælge den ønskede bagsidetype for blokkene.","Vælg indstillinger for Papir.","Papirnavn: Gør det muligt at vælge et papirnavn fra en liste eller opret et nyt Papirnavn.","Andet format: Denne indstilling gør det muligt at vælge papirformat eller oprette et brugerdefineret format.","Anden farve: Gør det muligt at vælge fra en liste over tilgængelige farver eller oprette en brugerdefineret farve.","Anden type: Gør det muligt at vælge papirtypen eller oprette brugerdefinerede papirtyper.","Anden vægt: Gør det muligt at vælge papirets vægt eller oprette en brugerdefineret papirvægt.","Avanceret papirvalg: Lader dig vælge avancerede papiregenskaber for dit omslag.","Klik på OK.","Oprettelse af blok","pads.html");
Page[34]=new Array("Pjecefunktionen udskriver to sider på hver side af papiret. Printerdriveren omsorterer siderne og placererer dem med korrekt retning og sidetal, når de foldes. Siderne kan derefter hæftes for at oprette en pjece. Husk, at en pjeces layout er anderledes end et dokuments layout med et billede på hver side af papiret. Linje- og sideombrydning varierer på samme måde.","Bemærk: ","Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Pjecer kan anvendes til at reducere det overordnede sidebillede, så det afpasses efter det valgte papirformat.","Sådan oprettes en pjece:","Klik på piltasterne i panelet Pjecer ud for Efterbehandling af pjecer og vælg en indstilling.","Ingen efterbehandling eller Foldning: Denne funktion hæfter eller folder ikke udskrivningsopgaven.","Pjecefalsning eller Foldning: Falser eller folder opgaven på midten.","Pjece/falsning eller Foldning og hæftning: Denne funktion falser eller folder udskrivningsopgaven på midten og hæfter to gange langs foldningen for at holde siderne på plads.","Slå pjecelayout fra: Anvender ikke indstillinger for pjeceformat i udskrivningsopgaven. Anvend denne indstilling, hvis din opgave allerede er formatteret som en pjece.","Klik på piltasterne ud for Afpas efter nyt papirformat for at lade printeren afpasse et billede efter et nyt papirformat. Vælg det ønskede papirformat. Klik på Brugerdefineret for at angive et brugerdefineret format.","Klik på piltasterne ud for Pjecemargen for at angive margenværdi og vælg en indstilling.","Standard reducerer sidebilledformatet, så dokumentet kan udskrives på et standardpapirformat uden tab af billede. Hvis din printer ikke kan udskrive til kanten af papiret, skal du vælge Standard.","Ingen: Denne indstilling udskriver dokumentet som en pjece uden at reducere formatet af sidebillederne. Denne indstilling kan beskære billedet, hvis printeren ikke kan udskrive til kanten af papiret.","Bemærk: Eksemplet viser 2 sider med A4-format på et ark med tabloid-format. Billedet til venstre anvender standardmargener. Der er valgt Ingen for billedet til højre. ","Angiv midtersletning og krympning, hvis det er nødvendigt.","Midtersletning: Angiver midtersletningens bredde i punkter mellem siderne. Indtast en værdi eller anvend piltasterne til at vælge antallet af punkter. Et punkt er lig med 0,35 mm.","Krympning: Angiver, hvor meget siden skal forskydes udad (i tiendedele af et punkt). Indtast en værdi eller anvend piltasterne til at vælge, hvor meget billederne på siden skal forskydes.","Klik på OK.","Pjecer","booklet_creation.html");
Page[35]=new Array("Sådan vælges en udfaldsbakke:","Klik på piltasterne ud for Udfaldsbakke i vinduet Papir/output og vælg en indstilling.","Vælg Printerens standard for at sende opgaven til en destination baseret på valgt papirformat og efterbehandling.","Bemærk: ","Visse papirmagasiner kan være utilgængelige afhængig af andre indstillinger.","Hvis din printer kun har en udfaldsbakke, vises denne liste ikke.","Udfaldsbakke","output_destination.html");
Page[36]=new Array("Specialsider er omslag, indsæt og undtagelsessider, som føjes til en udskrivningsopgave. Undtagelsessider har andre indstillinger end resten af siderne i opgaven.","Tilføjelse af omslag","Tilføjelse af indsæt","Tilføjelse af undtagelser","Administration af specialsider","Specialsider, som allerede er indstillet for dine udskrivningsopgaver, vises i oversigtstabellen Specialsider. I tabellen kan du vælge en side, der skal redigeres eller slettes. Du kan også ændre indsættenes rækkefølge i en gruppe af indsæt.","Sådan redigeres, slettes eller flyttes indstillinger:","Vælg en indstilling i listen over gemte sider. Knapperne er aktive.","Klik på knapperne for at vælge den ønskede handling.","Specialsider","special_pages.html");
Page[37]=new Array("Anvend vinduet Tilføj omslag til at føje omslag til hver kopi af et dokument og angive omslagsegenskaber. Feltet Opgaveindstilling viser papirindstillingerne for selve opgaven. Vælg Anvend opgaveindstilling for at anvende opgaveindstillingen for en omslagsegenskab.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan tilføjes omslag:","Klik på knappen Tilføj omslag i vinduet Specialsider.","Klik på OK for at acceptere opgavestandardindstillingerne for alle indstillinger.","Vælg en omslagsindstilling i listen Omslagsindstillinger for at foretage valg.","Ingen omslag annullerer alle tidligere omslagsindstillinger.","Kun forside: Denne indstilling udskriver første side i opgaven på papir fra det valgte magasin. Ved automatisk 2-sidet udskrivning udskrives de første to sider på omslaget.","Kun bagside: Denne indstilling udskriver bagsiden i opgaven på papir fra det valgte magasin. Ved automatisk 2-sidet udskrivning udskrives de sidste to sider på omslaget, hvis sættet indeholder et lige antal sider.","Forside og bagside: Samme: Denne indstilling udskriver for- og bagside fra det samme magasin.","For- og bagside: Forskellig: Fremfører papir for forsiden og for bagsiden fra forskellige magasiner.","Hvis du vil vælge papirets format, farve eller type, skal du klikke på piltasterne ud for Papir til for- eller bagside og vælge indstillinger. ","Vælg udskrivningsindstillinger for omslag.","Blanke eller trykte: Anvender blankt eller fortrykt papir for omslaget.","Udskriv på side 1 udskriver på forsiden af omslaget.","Udskriv på side 2: Udskriver kun på side 2 af omslaget.","Udskriv på begge sider: Udskriver på begge sider af omslaget.","Klik på OK.","Tilføj omslag","add_covers.html");
Page[38]=new Array("Du kan tilføje blanke eller fortrykte indsæt før side 1 i et dokument eller efter bestemte sider i dokumentet. Du kan f.eks. indsætte et blankt farvet ark papir efter hvert afsnit i et dokument. Noter sidetallene, hvor hvert afsnit slutter. Anvend disse sidetal til at indsætte et ark efter hver angivet side.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan tilføjes et indsæt:","Klik på knappen Tilføj indsæt i vinduet Specialsider.","Vælg indsættypen:","Før side 1 placerer et indsæt før side 1.","Efter side(r): Placerer et indsæt efter de(n) sider, du angiver.","Indtast sidetallet for de(n) sider, som kommer før hvert indsæt i feltet Side(r).","Under Antal skal du vælge angive det ønskede antal indsæt.","Klik på OK for at acceptere opgavestandardindstillingerne for alle indstillinger.","Hvis du vil vælge format, farve eller type, skal du klikke på piltasterne ud for Papir og vælge indstillinger.","Klik på OK.","Tilføj indsæt","add_inserts.html");
Page[39]=new Array("Anvend Tilføj undtagelser til at angive undtagelsessider i din udskrivningsopgave. Undtagelsessider har andre indstillinger end resten af siderne i opgaven. Du kan specificere forskelle, f.eks. sideformat, type og farve. Du kan også ændre den side af papiret, hvorpå der skal udskrives alt efter behov. En opgave kan indeholde mange undtagelser.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Undtagelser for papiroutput","Klik på knappen Tilføj undtagelser i vinduet Specialsider.","For Side(r) skal du angive den side eller sider, hvortil undtagelsen skal tilføjes. Individuelle sider eller sideintervaller skal adskilles med kommaer. Specificerer en række på hinanden følgende sider vha. en bindestreg. Hvis der f.eks. skal vælges siderne 1, 6, 9, 10 og 11, skal du skrive 1, 6, 9-11.","Klik på OK for at acceptere opgavestandardindstillingerne for alle indstillinger.","Hvis du vil vælge format, farve, type eller vægt, skal du klikke på piltasterne ud for Papir og vælge indstillinger.","Hvis du valgte Faneblade for Papirtype, skal du indtaste antallet af faneblade under Nummer i sekvens.","Hvis du vælger Forsorteret papir under Papirtype, skal du angive papirtypenavnet og nummeret i sekvensen.","Hvis du vil ændre den side, der skal udskrives på ved 2-sidet udskrivning, skal du vælge en indstilling:","1-sidet udskrivning: Udskriver kun undtagelsessiderne på den ene side.","2-sidet udskrivning: Udskriver undtagelsessiderne på begge sider af papiret og vender siderne langs den lange kant. Opgaven kan derefter indbindes langs den lange kant af papiret.","2-sidet, blokformat: Udskriver undtagelsessiderne på begge sider af papiret og vender siderne langs den korte kant. Opgaven kan derefter indbindes langs den korte kant af papiret.","Vælg en indstilling for Outputfarve.","Klik på OK.","Undtagelser for billedkvalitet","I vinduet Billedkvalitet kan du ændre udseendet på de udskrevne dokumenter.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Farvet","Gennemsigtig toner eller Object Based Clear","Gennemsigtig toner kan få dit udskrevne billede til at ligne et fotografi eller bruges til at fremhæve et billede, tekst eller grafik.","Bemærk: Ikke alle de viste indstillinger kan bruges på alle printere. Visse muligheder gælder kun for specifikke printermodeller, operativsystemer eller drivertyper.","Sådan anvendes Gennemsigtig toner:","Vælg en indstilling i vinduet Gennemsigtig toner eller Slet indstillinger.","Printerstandard: Anvender de aktuelle printerindstillinger.","Flood Clear: Dækker hele siden med gennemsigtig toner.","Kun billeder: Dækker kun sideobjekter, der er identificeret som billeder.","Kun tekst: Dækker kun tekst med gennemsigtig toner.","Kun grafik: Dækker kun grafik med gennemsigtig toner.","Ikke billeder (kun tekst, grafik): Dækker hele siden, tekst og grafik med gennemsigtig toner undtagen billeder.","Ikke tekst (kun billeder, grafik): Dækker hele siden, billeder og grafik med gennemsigtig toner undtagen billeder.","Ikke grafik (kun billeder, tekst): Dækker hele siden, billeder og tekst med gennemsigtig toner undtagen billeder.","Tilsidesæt gennemsigtig: Dækker ikke siden med gennemsigtig toner.","Anvend Embedded Clear: Printeren bruger instruktionerne i PDL til at anvende gennemsigtig toner.","Printeren bruger Page Description Language (PDL) til at udforme en udskrevet side. PDL'er omfatter PostScript (PS) og Printer Command Language (PCL).","Hvis du ønsker at specificere mængden af gennemsigtig toner, skal du klikke på piltasterne ud for Gennemsigtig mængde og vælge en indstilling.","Klik på OK.","Anti-aliasing","Anti-aliasing udglatter udseendet af ​​takkede kanter i billeder og tekst.","Sådan vælges en indstilling for Anti-aliasing:","Vælg en indstilling for Anti-aliasing i vinduet Printkvalitet.","Printerstandard: Anvender de aktuelle printerindstillinger.","Ja: Aktiverer Anti-aliasing.","Nej: Inaktiverer Anti-aliasing.","K100% høj opløsning: Anvender tydelig sort farve. Anvend denne funktion til f.eks. fin tekst eller grafik, der indeholder sorte områder.","Bruger TRC","Tone reproduction curves (TRC'er) vedligeholder farvekonsistensen på det trykte billede. Bruger TRC'er giver dig mulighed for at finjustere de udskrevne farver ved at justere reproduktionskurver.","Sådan udskrives med TRC'er:","Vælg en indstilling for Bruger TRC'er i vinduet Printkvalitet.","Printerstandard: Anvender standardprinterindstillinger.","Vælg et navn i listen over de 10 sidstindtastede TRC-navne.","Indtast et nyt navn.","Opløsning","Opløsning vil afgøre kvaliteten af grafiske billeder. Billedopløsning måles i dpi (dots per inch). Hvis der vælges en opløsning på 600 dpi, gengives billedet med 600 dots (pixels) per tomme af billedet. En højere opløsning giver en bedre printkvalitet.","Klik på Opløsning, og vælg en indstilling eller vælg Printerens standardindstilling for at vælge opløsning.","Rasterering","Gråtonet er en udskrivningsmetode, hvor relativ mørkhed, tæthed og størrelsen af små prikker er forskellig for at gengive variationer i farve og lysstyrke. Mængden af detaljer i en gråtone afhænger af antallet af dpi (dots per inch). Desto større dpi, desto flere detaljer i udskriften. Gråtonet omtales nogle gange som rastereret.","Stokastisk rasterering anvender en proces, der er baseret på en tilfældig fordeling af punkter, hvor du angiver tætheden af punkter i henhold til den ønskede grå nuance. Stokastisk er designet til at undgå, at der dannes moirémønstre. Den tilfældige karakter af stokastisk rasterering er specielt god til gengivelse fotografier.","Sådan vælges indstillinger for Rasterering:","Klik på Rasterering i vinduet Billedkvalitet og vælg en indstilling.","Printerstandard: Anvender standardprinterindstillinger.","Vælg en værdi. Desto flere prikker, linjer eller linjer per inch (lpi) du vælger, desto flere detaljer vises der i udskrivningsopgaven.","Vælg Stokastisk.","Tonersparer","Tonersparer reducerer mængden af ​​toner, der bruges ved udskrivning og er nyttig til at udskrive kladder. Printkvaliteten er lidt dårligere, end når der er valgt Standard.","I vinduet Printkvalitet skal du klikke på piltasterne ud for Tonersparer og dernæst vælge Ja.","Billedforskydning","Billedforskydning gør det muligt at ændre billedets placering på siden. Du kan forskyde det udskrevne billede langs X- og Y-aksen på hvert ark.","Sådan vælges indstillinger for Billedforskydning:","Klik på piltasterne og vælge den ønskede indstilling ud for Billedforskydning.","Hvis du vælger 1-sidet udskrivning i vinduet Papir/output, skal du vælge en indstilling for Billedforskydning.","Printerstandard: Anvender standardprinterindstillinger.","Individuel: Giver dig mulighed for at justere indstillingerne manuelt.","Hvis du vælger 2-sidet udskrivning i vinduet Papir/output, skal du vælge en indstilling for Billedforskydning.","Printerstandard: Anvender standardprinterindstillinger.","Individuel: Giver dig mulighed for at justere indstillingerne manuelt.","Spejlvend X: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i modsatte retninger langs X-aksen samtidigt.","Spejlvend Y: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i modsatte retninger langs Y-aksen samtidigt.","Spejlvend begge: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i modsatte retninger langs X- og Y-aksen samtidigt.","Spejlvend X, og så Y: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i modsatte retninger langs X-aksen og i samme retning langs Y-aksen samtidigt.","Spejlvend Y, og så X: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i modsatte retninger langs Y-aksen og i samme retning langs X-aksen samtidigt.","Tandem X: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i samme retning langs X-aksen samtidigt.","Tandem Y: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i samme retning langs Y-aksen samtidigt.","Tandem begge: Gør det muligt at flytte billeder på begge sider i en lige stor afstand, men i samme retning langs X og Y-aksen samtidigt.","Gør et af følgende for Individuelt:","Indtast den ønskede mængde forskydning for side 1 for at flytte sidens billede langs X-aksen og Y-aksen.","Hvis side 2 er tilgængelig, skal du indtaste den ønskede forskydning af billedet langs X-aksen og Y-aksen.","Bemærk: Side 2-indstillingen er kun tilgængelig, hvis der er valgt 2-sidet udskrivning.","Klik på OK.","Fremhævningsfarve","Fremhævningsfarve gør det muligt at fremhæve vigtig tekst eller dele på udskriften.","Sådan vælges fremhævningsmetoder:","Klik på Fremhævningsfarve i vinduet Billedkvalitet.","Vælg en indstilling.","Printerstandard: Anvender standardprinterindstillinger.","Mapping-algoritme: Afgør, hvordan alle farver udskrives, bortset fra den farve, som du vælger i Mapping-farve til fremhævning. Valgene anvender forskellige algoritmer for forskellige resultater.","Mapping-farve til fremhævning: Vælger en bestemt farve til fremhævning.","Udskrivningsfarve til fremhævning: Udskriver dokumentet i den farve, som du vælger.","Konfliktregel: Angiver, hvordan forskelle mellem den valgte farve og printerens farvemuligheder håndteres.","Lysstyrke","Tilføj undtagelser","add_exceptions.html");
